import React from "react";
import _ from "lodash";
import Like from "./like";

const TableBody = props => {
  const { data, columns, onDelete, onLiked } = props;
  return (
    <tbody>
      {data.map(item => (
        <tr key={item._id}>
          {columns.map(column => (
            <td>{_.get(item, column.path)}</td>
          ))}
        </tr>
      ))}
    </tbody>
  );
};

export default TableBody;
